import React from 'react';

// List of games with image + name
const games = [
  { title: 'Fire Link', image: '/src/assets/firelink.png' },
  { title: 'Buffalo', image: '/src/assets/buffalo.png' },
  { title: 'Fishing Paradise', image: '/src/assets/fishing.png' },
  { title: 'Huff Pigs', image: '/src/assets/huff.png' },
  { title: 'Fortune King', image: '/src/assets/fortune.png' },
  { title: 'Hyper Karts', image: '/src/assets/karts.png' },
  { title: 'Queenie', image: '/src/assets/queenie.png' },
  { title: 'Rich Piggies', image: '/src/assets/rich.png' },
];

const FreeToPlaySection = () => {
  return (
    <section className="bg-black text-white px-4 py-16">
      {/* Title */}
      <div className="text-center mb-12">
        <h2 className="text-3xl md:text-4xl font-bold mb-4">FREE TO PLAY</h2>
        <p className="text-gray-300 max-w-3xl mx-auto">
          Play Free games with no download required, no registration, and no purchase necessary.
        </p>
      </div>

      {/* Game grid */}
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-10 max-w-7xl mx-auto">
        {games.map((game, index) => (
          <div key={index} className="flex flex-col items-center">
            <img
              src={game.image}
              alt={game.title}
              className="w-full h-40 object-cover rounded shadow-md"
            />
            <button className="mt-4 bg-blue-500 hover:bg-blue-600 text-white px-6 py-2 rounded font-semibold">
              PLAY FREE
            </button>
          </div>
        ))}
      </div>
    </section>
  );
};

export default FreeToPlaySection;
